arasuperobject.biblemap.put("b20_5_10", new arasuperobject(20,5,10,"لئلا تشبع الاجانب من قوتك وتكون اتعابك في بيت غريب"));
arasuperobject.biblemap.put("b20_5_11", new arasuperobject(20,5,11,"فتنوح في اواخرك عند فناء لحمك وجسمك"));
arasuperobject.biblemap.put("b20_5_12", new arasuperobject(20,5,12,"فتقول كيف اني ابغضت الادب ورذل قلبي التوبيخ"));
arasuperobject.biblemap.put("b20_5_13", new arasuperobject(20,5,13,"ولم اسمع لصوت مرشدي ولم امل اذني الى معلميّ"));
arasuperobject.biblemap.put("b20_5_14", new arasuperobject(20,5,14,"لولا قليل لكنت في كل شر في وسط الزمرة والجماعة"));
arasuperobject.biblemap.put("b20_5_15", new arasuperobject(20,5,15,"اشرب مياها من جبك ومياها جارية من بئرك"));
arasuperobject.biblemap.put("b20_5_16", new arasuperobject(20,5,16,"لا تفض ينابيعك الى الخارج سواقي مياه في الشوارع"));
arasuperobject.biblemap.put("b20_5_17", new arasuperobject(20,5,17,"لتكن لك وحدك وليس لاجانب معك"));
arasuperobject.biblemap.put("b20_5_18", new arasuperobject(20,5,18,"ليكن ينبوعك مباركا وافرح بامرأة شبابك"));
arasuperobject.biblemap.put("b20_5_19", new arasuperobject(20,5,19,"الظبية المحبوبة والوعلة الزهية. ليروك ثدياها في كل وقت وبمحبتها اسكر دائما"));
arasuperobject.biblemap.put("b20_5_20", new arasuperobject(20,5,20,"فلم تفتن يا ابني باجنبية وتحتضن غريبة"));
arasuperobject.biblemap.put("b20_5_21", new arasuperobject(20,5,21,"لان طرق الانسان امام عيني الرب وهو يزن كل سبله"));
arasuperobject.biblemap.put("b20_5_22", new arasuperobject(20,5,22,"الشرير تأخذه آثامه وبحبال خطيته يمسك"));
arasuperobject.biblemap.put("b20_5_23", new arasuperobject(20,5,23,"انه يموت من عدم الادب وبفرط حمقه يتهور"));
arasuperobject.biblemap.put("b20_6_1", new arasuperobject(20,6,1,"يا ابني ان ضمنت صاحبك ان صفقت كفك لغريب"));
arasuperobject.biblemap.put("b20_6_2", new arasuperobject(20,6,2,"ان علقت في كلام فمك ان اخذت في كلام فيك"));
arasuperobject.biblemap.put("b20_6_3", new arasuperobject(20,6,3,"اذا فافعل هذا يا ابني ونج نفسك اذا صرت في يد صاحبك. اذهب ترام والحّ على صاحبك"));
arasuperobject.biblemap.put("b20_6_4", new arasuperobject(20,6,4,"لا تعط عينيك نوما ولا اجفانك نعاسا"));
arasuperobject.biblemap.put("b20_6_5", new arasuperobject(20,6,5,"نج نفسك كالضبي من اليد كالعصفور من يد الصياد"));
arasuperobject.biblemap.put("b20_6_6", new arasuperobject(20,6,6,"اذهب الى النملة ايها الكسلان. تأمل طرقها وكن حكيما"));
arasuperobject.biblemap.put("b20_6_7", new arasuperobject(20,6,7,"التي ليس لها قائد او عريف او متسلط"));
arasuperobject.biblemap.put("b20_6_8", new arasuperobject(20,6,8,"وتعد في الصيف طعامها وتجمع في الحصاد اكلها"));
arasuperobject.biblemap.put("b20_6_9", new arasuperobject(20,6,9,"الى متى تنام ايها الكسلان. متى تنهض من نومك"));
arasuperobject.biblemap.put("b20_6_10", new arasuperobject(20,6,10,"قليل نوم بعد قليل نعاس وطي اليدين قليلا للرقود"));
arasuperobject.biblemap.put("b20_6_11", new arasuperobject(20,6,11,"فياتي فقرك كساع وعوزك كغاز"));
arasuperobject.biblemap.put("b20_6_12", new arasuperobject(20,6,12,"الرجل اللئيم الرجل الاثيم يسعى باعوجاج الفم"));
arasuperobject.biblemap.put("b20_6_13", new arasuperobject(20,6,13,"يغمز بعينيه يقول برجله يشير باصابعه"));
arasuperobject.biblemap.put("b20_6_14", new arasuperobject(20,6,14,"في قلبه اكاذيب. يخترع الشر في كل حين. يزرع خصومات"));
arasuperobject.biblemap.put("b20_6_15", new arasuperobject(20,6,15,"لاجل ذلك بغتة تفاجئه بليته. في لحظة ينكسر ولا شفاء"));
arasuperobject.biblemap.put("b20_6_16", new arasuperobject(20,6,16,"هذه الستة يبغضها الرب وسبعة هي مكرهة نفسه"));
arasuperobject.biblemap.put("b20_6_17", new arasuperobject(20,6,17,"عيون متعالية لسان كاذب ايد سافكة دما بريئا"));
arasuperobject.biblemap.put("b20_6_18", new arasuperobject(20,6,18,"قلب ينشئ افكارا رديئة ارجل سريعة الجريان الى السوء"));
arasuperobject.biblemap.put("b20_6_19", new arasuperobject(20,6,19,"شاهد زور يفوه بالاكاذيب وزارع خصومات بين اخوة"));
arasuperobject.biblemap.put("b20_6_20", new arasuperobject(20,6,20,"يا ابني احفظ وصايا ابيك ولا تترك شريعة امك"));
arasuperobject.biblemap.put("b20_6_21", new arasuperobject(20,6,21,"اربطها على قلبك دائما. قلّد بها عنقك"));
arasuperobject.biblemap.put("b20_6_22", new arasuperobject(20,6,22,"اذا ذهبت تهديك. اذا نمت تحرسك واذا استيقظت فهي تحدّثك"));
arasuperobject.biblemap.put("b20_6_23", new arasuperobject(20,6,23,"لان الوصية مصباح والشريعة نور وتوبيخات الادب طريق الحياة"));
arasuperobject.biblemap.put("b20_6_24", new arasuperobject(20,6,24,"لحفظك من المرأة الشريرة من ملق لسان الاجنبية"));
arasuperobject.biblemap.put("b20_6_25", new arasuperobject(20,6,25,"لا تشتهين جمالها بقلبك ولا تأخذك بهدبها"));
arasuperobject.biblemap.put("b20_6_26", new arasuperobject(20,6,26,"لانه بسبب امرأة زانية يفتقر المرء الى رغيف خبز وامرأة رجل آخر تقتنص النفس الكريمة"));
arasuperobject.biblemap.put("b20_6_27", new arasuperobject(20,6,27,"أيأخذ انسان نارا في حضنه ولا تحترق ثيابه"));
arasuperobject.biblemap.put("b20_6_28", new arasuperobject(20,6,28,"او يمشي انسان على الجمر ولا تكتوي رجلاه"));
arasuperobject.biblemap.put("b20_6_29", new arasuperobject(20,6,29,"هكذا من يدخل على امرأة صاحبه. كل من يمسّها لا يكون بريئا"));
arasuperobject.biblemap.put("b20_6_30", new arasuperobject(20,6,30,"لا يستخفون بالسارق ولو سرق ليشبع نفسه وهو جوعان"));
arasuperobject.biblemap.put("b20_6_31", new arasuperobject(20,6,31,"ان وجد يرد سبعة اضعاف ويعطي كل قنية بيته"));
arasuperobject.biblemap.put("b20_6_32", new arasuperobject(20,6,32,"اما الزاني بامرأة فعديم العقل. المهلك نفسه هو يفعله"));
arasuperobject.biblemap.put("b20_6_33", new arasuperobject(20,6,33,"ضربا وخزيا يجد وعاره لا يمحى"));
arasuperobject.biblemap.put("b20_6_34", new arasuperobject(20,6,34,"لان الغيرة هي حمية الرجل فلا يشفق في يوم الانتقام"));
arasuperobject.biblemap.put("b20_6_35", new arasuperobject(20,6,35,"لا ينظر الى فدية ما ولا يرضى ولو اكثرت الرشوة"));
arasuperobject.biblemap.put("b20_7_1", new arasuperobject(20,7,1,"يا ابني احفظ كلامي واذخر وصاياي عندك"));
arasuperobject.biblemap.put("b20_7_2", new arasuperobject(20,7,2,"احفظ وصاياي فتحيا وشريعتي كحدقة عينك"));
arasuperobject.biblemap.put("b20_7_3", new arasuperobject(20,7,3,"اربطها على اصابعك اكتبها على لوح قلبك"));
arasuperobject.biblemap.put("b20_7_4", new arasuperobject(20,7,4,"قل للحكمة انت اختي وادع الفهم ذا قرابة"));
arasuperobject.biblemap.put("b20_7_5", new arasuperobject(20,7,5,"لتحفظك من المرأة الاجنبية من الغريبة الملقة بكلامها"));
arasuperobject.biblemap.put("b20_7_6", new arasuperobject(20,7,6,"لاني من كوة بيتي من وراء شباكي تطلعت"));
arasuperobject.biblemap.put("b20_7_7", new arasuperobject(20,7,7,"فرايت بين الجهال لاحظت بين البنين غلاما عديم الفهم"));
arasuperobject.biblemap.put("b20_7_8", new arasuperobject(20,7,8,"عابرا في الشارع عند زاويتها وصاعدا في طريق بيتها"));
arasuperobject.biblemap.put("b20_7_9", new arasuperobject(20,7,9,"في العشاء في مساء اليوم في حدقة الليل والظلام"));
arasuperobject.biblemap.put("b20_7_10", new arasuperobject(20,7,10,"واذ بامرأة استقبلته في زي زانية وخبيثة القلب"));
arasuperobject.biblemap.put("b20_7_11", new arasuperobject(20,7,11,"صخّابة هي وجامحة. في بيتها لا تستقر قدماها"));
arasuperobject.biblemap.put("b20_7_12", new arasuperobject(20,7,12,"تارة في الخارج واخرى في الشوارع. وعند كل زاوية تكمن"));
arasuperobject.biblemap.put("b20_7_13", new arasuperobject(20,7,13,"فامسكته وقبّلته. اوقحت وجهها وقالت له"));
arasuperobject.biblemap.put("b20_7_14", new arasuperobject(20,7,14,"عليّ ذبائح السلامة. اليوم اوفيت نذوري"));
arasuperobject.biblemap.put("b20_7_15", new arasuperobject(20,7,15,"فلذلك خرجت للقائك لاطلب وجهك حتى اجدك"));
arasuperobject.biblemap.put("b20_7_16", new arasuperobject(20,7,16,"بالديباج فرشت سريري بموشّى كتان من مصر"));
arasuperobject.biblemap.put("b20_7_17", new arasuperobject(20,7,17,"عطرت فراشي بمرّ وعود وقرفة"));
arasuperobject.biblemap.put("b20_7_18", new arasuperobject(20,7,18,"هلم نرتو ودّا الى الصباح. نتلذذ بالحب"));
arasuperobject.biblemap.put("b20_7_19", new arasuperobject(20,7,19,"لان الرجل ليس في البيت. ذهب في طريق بعيدة"));
arasuperobject.biblemap.put("b20_7_20", new arasuperobject(20,7,20,"اخذ صرّة الفضة بيده. يوم الهلال ياتي الى بيته"));
arasuperobject.biblemap.put("b20_7_21", new arasuperobject(20,7,21,"اغوته بكثرة فنونها بملث شفتيها طوحته"));
arasuperobject.biblemap.put("b20_7_22", new arasuperobject(20,7,22,"ذهب وراءها لوقته كثور يذهب الى الذبح او كالغبي الى قيد القصاص"));
arasuperobject.biblemap.put("b20_7_23", new arasuperobject(20,7,23,"حتى يشق سهم كبده. كطير يسرع الى الفخ ولا يدري انه لنفسه"));
arasuperobject.biblemap.put("b20_7_24", new arasuperobject(20,7,24,"والآن ايها الابناء اسمعوا لي واصغوا لكلمات فمي"));
arasuperobject.biblemap.put("b20_7_25", new arasuperobject(20,7,25,"لا يمل قلبك الى طرقها ولا تشرد في مسالكها"));
arasuperobject.biblemap.put("b20_7_26", new arasuperobject(20,7,26,"لانها طرحت كثيرين جرحى وكل قتلاها اقوياء"));
arasuperobject.biblemap.put("b20_7_27", new arasuperobject(20,7,27,"طرق الهاوية بيتها هابطة الى خدور الموت"));
arasuperobject.biblemap.put("b20_8_1", new arasuperobject(20,8,1,"ألعل الحكمة لا تنادي والفهم ألا يعطي صوته"));
arasuperobject.biblemap.put("b20_8_2", new arasuperobject(20,8,2,"عند رؤوس الشواهق عند الطريق بين المسالك تقف"));
arasuperobject.biblemap.put("b20_8_3", new arasuperobject(20,8,3,"بجانب الابواب عند ثغر المدينة عند مدخل الابواب تصرّح"));
arasuperobject.biblemap.put("b20_8_4", new arasuperobject(20,8,4,"لكم ايها الناس انادي وصوتي الى بني آدم"));
arasuperobject.biblemap.put("b20_8_5", new arasuperobject(20,8,5,"ايها الحمقى تعلموا ذكاء ويا جهال تعلموا فهما"));
arasuperobject.biblemap.put("b20_8_6", new arasuperobject(20,8,6,"اسمعوا فاني اتكلم بامور شريفة وافتتاح شفتيّ استقامة"));
arasuperobject.biblemap.put("b20_8_7", new arasuperobject(20,8,7,"لان حنكي يلهج بالصدق ومكرهة شفتيّ الكذب"));
arasuperobject.biblemap.put("b20_8_8", new arasuperobject(20,8,8,"كل كلمات فمي بالحق. ليس فيها عوج ولا التواء"));
arasuperobject.biblemap.put("b20_8_9", new arasuperobject(20,8,9,"كلها واضحة لدى الفهيم ومستقيمة لدى الذين يجدون المعرفة"));
arasuperobject.biblemap.put("b20_8_10", new arasuperobject(20,8,10,"خذوا تاديبي لا الفضة. والمعرفة اكثر من الذهب المختار"));
arasuperobject.biblemap.put("b20_8_11", new arasuperobject(20,8,11,"لان الحكمة خير من اللآلئ وكل الجواهر لا تساويها"));
arasuperobject.biblemap.put("b20_8_12", new arasuperobject(20,8,12,"انا الحكمة اسكن الذكاء واجد معرفة التدابير"));
arasuperobject.biblemap.put("b20_8_13", new arasuperobject(20,8,13,"مخافة الرب بغض الشر. الكبرياء والتعظم وطريق الشر وفم الاكاذيب ابغضت"));
arasuperobject.biblemap.put("b20_8_14", new arasuperobject(20,8,14,"لي المشورة والرأي. انا الفهم. لي القدرة"));
arasuperobject.biblemap.put("b20_8_15", new arasuperobject(20,8,15,"بي تملك الملوك وتقضي العظماء عدلا"));
arasuperobject.biblemap.put("b20_8_16", new arasuperobject(20,8,16,"بي تترأس الرؤساء والشرفاء. كل قضاة الارض"));
arasuperobject.biblemap.put("b20_8_17", new arasuperobject(20,8,17,"انا احب الذين يحبونني والذين يبكّرون اليّ يجدونني"));
arasuperobject.biblemap.put("b20_8_18", new arasuperobject(20,8,18,"عندي الغنى والكرامة. قنية فاخرة وحظ"));
arasuperobject.biblemap.put("b20_8_19", new arasuperobject(20,8,19,"ثمري خير من الذهب ومن الابريز وغلتي خير من الفضة المختارة"));
arasuperobject.biblemap.put("b20_8_20", new arasuperobject(20,8,20,"في طريق العدل اتمشى في وسط سبل الحق"));
arasuperobject.biblemap.put("b20_8_21", new arasuperobject(20,8,21,"فاورّث محبيّ رزقا واملأ خزائنهم"));
arasuperobject.biblemap.put("b20_8_22", new arasuperobject(20,8,22,"الرب قناني اول طريقه من قبل اعماله منذ القدم"));
arasuperobject.biblemap.put("b20_8_23", new arasuperobject(20,8,23,"منذ الازل مسحت منذ البدء منذ اوائل الارض"));
arasuperobject.biblemap.put("b20_8_24", new arasuperobject(20,8,24,"اذ لم يكن غمر أبدئت اذ لم تكن ينابيع كثيرة المياه"));
arasuperobject.biblemap.put("b20_8_25", new arasuperobject(20,8,25,"من قبل ان تقررت الجبال قبل التلال أبدئت"));
arasuperobject.biblemap.put("b20_8_26", new arasuperobject(20,8,26,"اذ لم يكن قد صنع الارض بعد ولا البراري ولا اول اعفار المسكونة"));
arasuperobject.biblemap.put("b20_8_27", new arasuperobject(20,8,27,"لما ثبت السموات كنت هناك انا. لما رسم دائرة على وجه الغمر"));
arasuperobject.biblemap.put("b20_8_28", new arasuperobject(20,8,28,"لما اثبت السحب من فوق لما تشددت ينابيع الغمر"));
arasuperobject.biblemap.put("b20_8_29", new arasuperobject(20,8,29,"لما وضع للبحر حده فلا تتعدى المياه تخمه لما رسم أسس الارض"));
arasuperobject.biblemap.put("b20_8_30", new arasuperobject(20,8,30,"كنت عنده صانعا وكنت كل يوم لذّته فرحة دائما قدامه"));
arasuperobject.biblemap.put("b20_8_31", new arasuperobject(20,8,31,"فرحة في مسكونة ارضه ولذّاتي مع بني آدم"));
arasuperobject.biblemap.put("b20_8_32", new arasuperobject(20,8,32,"فالآن ايها البنون اسمعوا لي. فطوبى للذين يحفظون طرقي"));
arasuperobject.biblemap.put("b20_8_33", new arasuperobject(20,8,33,"اسمعوا التعليم وكونوا حكماء ولا ترفضوه"));
arasuperobject.biblemap.put("b20_8_34", new arasuperobject(20,8,34,"طوبى للانسان الذي يسمع لي ساهرا كل يوم عند مصاريعي حافظا قوائم ابوابي"));
arasuperobject.biblemap.put("b20_8_35", new arasuperobject(20,8,35,"لانه من يجدني يجد الحياة وينال رضى من الرب"));
arasuperobject.biblemap.put("b20_8_36", new arasuperobject(20,8,36,"ومن يخطئ عني يضر نفسه. كل مبغضي يحبون الموت"));
arasuperobject.biblemap.put("b20_9_1", new arasuperobject(20,9,1,"الحكمة بنت بيتها. نحتت اعمدتها السبعة"));
arasuperobject.biblemap.put("b20_9_2", new arasuperobject(20,9,2,"ذبحت ذبحها مزجت خمرها. ايضا رتبت مائدتها"));
arasuperobject.biblemap.put("b20_9_3", new arasuperobject(20,9,3,"ارسلت جواريها تنادي على ظهور اعالي المدينة"));
arasuperobject.biblemap.put("b20_9_4", new arasuperobject(20,9,4,"من هو جاهل فليمل الى هنا. والناقص الفهم قالت له"));
arasuperobject.biblemap.put("b20_9_5", new arasuperobject(20,9,5,"هلموا كلوا من طعامي واشربوا من الخمر التي مزجتها"));
arasuperobject.biblemap.put("b20_9_6", new arasuperobject(20,9,6,"اتركوا الجهالات فتحيوا وسيروا في طريق الفهم"));
arasuperobject.biblemap.put("b20_9_7", new arasuperobject(20,9,7,"من يوبخ مستهزئا يكسب لنفسه هوانا ومن ينذر شريرا يكسب عيبا"));
arasuperobject.biblemap.put("b20_9_8", new arasuperobject(20,9,8,"لا توبخ مستهزئا لئلا يبغضك. وبخ حكيما فيحبك"));
arasuperobject.biblemap.put("b20_9_9", new arasuperobject(20,9,9,"اعط حكيما فيكون اوفر حكمة. علّم صدّيقا فيزداد علما"));
arasuperobject.biblemap.put("b20_9_10", new arasuperobject(20,9,10,"بدء الحكمة مخافة الرب ومعرفة القدوس فهم"));
