arasuperobject.biblemap.put("b20_21_29", new arasuperobject(20,21,29,"الشرير يوقح وجهه. اما المستقيم فيثبّت طرقه"));
arasuperobject.biblemap.put("b20_21_30", new arasuperobject(20,21,30,"ليس حكمة ولا فطنة ولا مشورة تجاه الرب"));
arasuperobject.biblemap.put("b20_21_31", new arasuperobject(20,21,31,"الفرس معد ليوم الحرب. اما النصرة فمن الرب"));
arasuperobject.biblemap.put("b20_22_1", new arasuperobject(20,22,1,"الصيت افضل من الغنى العظيم والنعمة الصالحة افضل من الفضة والذهب"));
arasuperobject.biblemap.put("b20_22_2", new arasuperobject(20,22,2,"الغني والفقير يتلاقيان. صانعهما كليهما الرب"));
arasuperobject.biblemap.put("b20_22_3", new arasuperobject(20,22,3,"الذكي يبصر الشر فيتوارى والحمقى يعبرون فيعاقبون"));
arasuperobject.biblemap.put("b20_22_4", new arasuperobject(20,22,4,"ثواب التواضع ومخافة الرب هو غنى وكرامة وحياة"));
arasuperobject.biblemap.put("b20_22_5", new arasuperobject(20,22,5,"شوك وفخوخ في طريق الملتوي. من يحفظ نفسه يبتعد عنها"));
arasuperobject.biblemap.put("b20_22_6", new arasuperobject(20,22,6,"ربّ الولد في طريقه فمتى شاخ ايضا لا يحيد عنه"));
arasuperobject.biblemap.put("b20_22_7", new arasuperobject(20,22,7,"الغني يتسلط على الفقير والمقترض عبد للمقرض"));
arasuperobject.biblemap.put("b20_22_8", new arasuperobject(20,22,8,"الزارع اثما يحصد بليّة وعصا سخطه تفنى"));
arasuperobject.biblemap.put("b20_22_9", new arasuperobject(20,22,9,"الصالح العين هو يبارك لانه يعطي من خبزه للفقير"));
arasuperobject.biblemap.put("b20_22_10", new arasuperobject(20,22,10,"اطرد المستهزئ فيخرج الخصام ويبطل النزاع والخزي"));
arasuperobject.biblemap.put("b20_22_11", new arasuperobject(20,22,11,"من احب طهارة القلب فلنعمة شفتيه يكون الملك صديقه"));
arasuperobject.biblemap.put("b20_22_12", new arasuperobject(20,22,12,"عينا الرب تحفظان المعرفة وهو يقلب كلام الغادرين"));
arasuperobject.biblemap.put("b20_22_13", new arasuperobject(20,22,13,"قال الكسلان الاسد في الخارج فأقتل في الشواع"));
arasuperobject.biblemap.put("b20_22_14", new arasuperobject(20,22,14,"فم الاجنبيات هوّة عميقة. ممقوت الرب يسقط فيها"));
arasuperobject.biblemap.put("b20_22_15", new arasuperobject(20,22,15,"الجهالة مرتبطة بقلب الولد. عصا التأديب تبعدها عنه"));
arasuperobject.biblemap.put("b20_22_16", new arasuperobject(20,22,16,"ظالم الفقير تكثيرا لما له ومعطي الغني انما هما للعوز"));
arasuperobject.biblemap.put("b20_22_17", new arasuperobject(20,22,17,"امل اذنك واسمع كلام الحكماء ووجّه قلبك الى معرفتي"));
arasuperobject.biblemap.put("b20_22_18", new arasuperobject(20,22,18,"لانه حسن ان حفظتها في جوفك. ان تتثبت جميعا على شفتيك"));
arasuperobject.biblemap.put("b20_22_19", new arasuperobject(20,22,19,"ليكون اتكالك على الرب عرّفتك انت اليوم"));
arasuperobject.biblemap.put("b20_22_20", new arasuperobject(20,22,20,"ألم اكتب لك أمورا شريفة من جهة مؤامرة ومعرفة"));
arasuperobject.biblemap.put("b20_22_21", new arasuperobject(20,22,21,"لاعلمك قسط كلام الحق لترد جواب الحق للذين ارسلوك"));
arasuperobject.biblemap.put("b20_22_22", new arasuperobject(20,22,22,"لا تسلب الفقير لكونه فقيرا ولا تسحق المسكين في الباب"));
arasuperobject.biblemap.put("b20_22_23", new arasuperobject(20,22,23,"لان الرب يقيم دعواهم ويسلب سالبي انفسهم"));
arasuperobject.biblemap.put("b20_22_24", new arasuperobject(20,22,24,"لا تستصحب غضوبا ومع رجل ساخط لا تجئ"));
arasuperobject.biblemap.put("b20_22_25", new arasuperobject(20,22,25,"لئلا تألف طرقه وتاخذ شركا الى نفسك"));
arasuperobject.biblemap.put("b20_22_26", new arasuperobject(20,22,26,"لا تكن من صافقي الكف ولا من ضامني الديون"));
arasuperobject.biblemap.put("b20_22_27", new arasuperobject(20,22,27,"ان لم يكن لك ما تفي فلماذا يأخذ فراشك من تحتك"));
arasuperobject.biblemap.put("b20_22_28", new arasuperobject(20,22,28,"لا تنقل التخم القديم الذي وضعه آباؤك"));
arasuperobject.biblemap.put("b20_22_29", new arasuperobject(20,22,29,"أرأيت رجلا مجتهدا في عمله. امام الملوك يقف لا يقف امام الرعاع"));
arasuperobject.biblemap.put("b20_23_1", new arasuperobject(20,23,1,"اذا جلست تاكل مع متسلط فتامل ما هو امامك تاملا"));
arasuperobject.biblemap.put("b20_23_2", new arasuperobject(20,23,2,"وضع سكينا لحنجرتك ان كنت شرها"));
arasuperobject.biblemap.put("b20_23_3", new arasuperobject(20,23,3,"لا تشته اطايبه لانها خبز اكاذيب"));
arasuperobject.biblemap.put("b20_23_4", new arasuperobject(20,23,4,"لا تتعب لكي تصير غنيا. كف عن فطنتك"));
arasuperobject.biblemap.put("b20_23_5", new arasuperobject(20,23,5,"هل تطيّر عينيك نحوه وليس هو. لانه انما يصنع لنفسه اجنحة. كالنسر يطير نحو السماء"));
arasuperobject.biblemap.put("b20_23_6", new arasuperobject(20,23,6,"لا تأكل خبز ذي عين شريرة ولا تشته اطايبه"));
arasuperobject.biblemap.put("b20_23_7", new arasuperobject(20,23,7,"لانه كما شعر في نفسه هكذا هو. يقول لك كل واشرب وقلبه ليس معك"));
arasuperobject.biblemap.put("b20_23_8", new arasuperobject(20,23,8,"اللقمة التي اكلتها تتقيأها وتخسر كلماتك الحلوة"));
arasuperobject.biblemap.put("b20_23_9", new arasuperobject(20,23,9,"في اذني جاهل لا تتكلم لانه يحتقر حكمة كلامك"));
arasuperobject.biblemap.put("b20_23_10", new arasuperobject(20,23,10,"لا تنقل التخم القديم ولا تدخل حقول الايتام"));
arasuperobject.biblemap.put("b20_23_11", new arasuperobject(20,23,11,"لان وليهم قوي. هو يقيم دعواهم عليك"));
arasuperobject.biblemap.put("b20_23_12", new arasuperobject(20,23,12,"وجّه قلبك الى الادب واذنيك الى كلمات المعرفة"));
arasuperobject.biblemap.put("b20_23_13", new arasuperobject(20,23,13,"لا تمنع التأديب عن الولد لانك ان ضربته بعصا لا يموت"));
arasuperobject.biblemap.put("b20_23_14", new arasuperobject(20,23,14,"تضربه انت بعصا فتنقذ نفسه من الهاوية"));
arasuperobject.biblemap.put("b20_23_15", new arasuperobject(20,23,15,"يا ابني ان كان قلبك حكيما يفرح قلبي انا ايضا"));
arasuperobject.biblemap.put("b20_23_16", new arasuperobject(20,23,16,"وتبتهج كليتاي اذا تكلمت شفتاك بالمستقيمات"));
arasuperobject.biblemap.put("b20_23_17", new arasuperobject(20,23,17,"لا يحسدن قلبك الخاطئين بل كن في مخافة الرب اليوم كله"));
arasuperobject.biblemap.put("b20_23_18", new arasuperobject(20,23,18,"لانه لا بد من ثواب ورجاؤك لا يخيب"));
arasuperobject.biblemap.put("b20_23_19", new arasuperobject(20,23,19,"اسمع انت يا ابني وكن حكيما وارشد قلبك في الطريق"));
arasuperobject.biblemap.put("b20_23_20", new arasuperobject(20,23,20,"لا تكن بين شريبي الخمر بين المتلفين اجسادهم"));
arasuperobject.biblemap.put("b20_23_21", new arasuperobject(20,23,21,"لان السكير والمسرف يفتقران والنوم يكسو الخرق"));
arasuperobject.biblemap.put("b20_23_22", new arasuperobject(20,23,22,"اسمع لابيك الذي ولدك ولا تحتقر امك اذا شاخت"));
arasuperobject.biblemap.put("b20_23_23", new arasuperobject(20,23,23,"اقتن الحق ولا تبعه والحكمة والادب والفهم"));
arasuperobject.biblemap.put("b20_23_24", new arasuperobject(20,23,24,"ابو الصدّيق يبتهج ابتهاجا ومن ولد حكيما يسرّ به"));
arasuperobject.biblemap.put("b20_23_25", new arasuperobject(20,23,25,"يفرح ابوك وامك وتبتهج التي ولدتك"));
arasuperobject.biblemap.put("b20_23_26", new arasuperobject(20,23,26,"يا ابني اعطني قلبك ولتلاحظ عيناك طرقي"));
arasuperobject.biblemap.put("b20_23_27", new arasuperobject(20,23,27,"لان الزانية هوة عميقة والاجنبية حفرة ضيّقة"));
arasuperobject.biblemap.put("b20_23_28", new arasuperobject(20,23,28,"هي ايضا كلص تكمن وتزيد الغادرين بين الناس"));
arasuperobject.biblemap.put("b20_23_29", new arasuperobject(20,23,29,"لمن الويل لمن الشقاوة لمن المخاصمات لمن الكرب لمن الجروح بلا سبب لمن ازمهرار العينين"));
arasuperobject.biblemap.put("b20_23_30", new arasuperobject(20,23,30,"للذين يدمنون الخمر الذين يدخلون في طلب الشراب الممزوج"));
arasuperobject.biblemap.put("b20_23_31", new arasuperobject(20,23,31,"لا تنظر الى الخمر اذ احمرّت حين تظهر حبابها في الكاس وساغت مرقرقة"));
arasuperobject.biblemap.put("b20_23_32", new arasuperobject(20,23,32,"في الآخر تلسع كالحية وتلدغ كالافعوان"));
arasuperobject.biblemap.put("b20_23_33", new arasuperobject(20,23,33,"عيناك تنظران الاجنبيات وقلبك ينطق بأمور ملتوية"));
arasuperobject.biblemap.put("b20_23_34", new arasuperobject(20,23,34,"وتكون كمضطجع في قلب البحر او كمضطجع على راس سارية"));
arasuperobject.biblemap.put("b20_23_35", new arasuperobject(20,23,35,"يقول ضربوني ولم اتوجع. لقد لكأوني ولم اعرف. متى استيقظ. اعود اطلبها بعد"));
arasuperobject.biblemap.put("b20_24_1", new arasuperobject(20,24,1,"لا تحسد اهل الشر ولا تشته ان تكون معهم"));
arasuperobject.biblemap.put("b20_24_2", new arasuperobject(20,24,2,"لان قلبهم يلهج بالاغتصاب وشفاههم تتكلم بالمشقة"));
arasuperobject.biblemap.put("b20_24_3", new arasuperobject(20,24,3,"بالحكمة يبنى البيت وبالفهم يثبت"));
arasuperobject.biblemap.put("b20_24_4", new arasuperobject(20,24,4,"وبالمعرفة تمتلئ المخادع من كل ثروة كريمة ونفيسة"));
arasuperobject.biblemap.put("b20_24_5", new arasuperobject(20,24,5,"الرجل الحكيم في عزّ وذو المعرفة متشدد القوة"));
arasuperobject.biblemap.put("b20_24_6", new arasuperobject(20,24,6,"لانك بالتدابير تعمل حربك والخلاص بكثرة المشيرين"));
arasuperobject.biblemap.put("b20_24_7", new arasuperobject(20,24,7,"الحكم عالية عن الاحمق. لا يفتح فمه في الباب"));
arasuperobject.biblemap.put("b20_24_8", new arasuperobject(20,24,8,"المفتكر في عمل الشر يدعى مفسدا"));
arasuperobject.biblemap.put("b20_24_9", new arasuperobject(20,24,9,"فكر الحماقة خطية. ومكرهة الناس المستهزئ"));
arasuperobject.biblemap.put("b20_24_10", new arasuperobject(20,24,10,"ان ارتخيت في يوم الضيق ضاقت قوتك"));
arasuperobject.biblemap.put("b20_24_11", new arasuperobject(20,24,11,"انقذ المنقادين الى الموت والممدودين للقتل. لا تمتنع"));
arasuperobject.biblemap.put("b20_24_12", new arasuperobject(20,24,12,"ان قلت هوذا لم نعرف هذا. أفلا يفهم وازن القلوب وحافظ نفسك ألا يعلم. فيرد على الانسان مثل عمله"));
arasuperobject.biblemap.put("b20_24_13", new arasuperobject(20,24,13,"يا ابني كل عسلا لانه طيب وقطر العسل حلو في حنكك"));
arasuperobject.biblemap.put("b20_24_14", new arasuperobject(20,24,14,"كذلك معرفة الحكمة لنفسك. اذا وجدتها فلا بد من ثواب ورجاؤك لا يخيب"));
arasuperobject.biblemap.put("b20_24_15", new arasuperobject(20,24,15,"لا تكمن ايها الشرير لمسكن الصدّيق. لا تخرب ربعه"));
arasuperobject.biblemap.put("b20_24_16", new arasuperobject(20,24,16,"لان الصدّيق يسقط سبع مرات ويقوم. اما الاشرار فيعثرون بالشر"));
arasuperobject.biblemap.put("b20_24_17", new arasuperobject(20,24,17,"لا تفرح بسقوط عدوك ولا يبتهج قلبك اذا عثر"));
arasuperobject.biblemap.put("b20_24_18", new arasuperobject(20,24,18,"لئلا يرى الرب ويسوء ذلك في عينيه فيرد عنه غضبه"));
arasuperobject.biblemap.put("b20_24_19", new arasuperobject(20,24,19,"لا تغر من الاشرار ولا تحسد الاثمة"));
arasuperobject.biblemap.put("b20_24_20", new arasuperobject(20,24,20,"لانه لا يكون ثواب للاشرار. سراج الاثمة ينطفئ"));
arasuperobject.biblemap.put("b20_24_21", new arasuperobject(20,24,21,"يا ابني اخش الرب والملك. لا تخالط المتقلبين"));
arasuperobject.biblemap.put("b20_24_22", new arasuperobject(20,24,22,"لان بليتهم تقوم بغتة ومن يعلم بلاءهما كليهما"));
arasuperobject.biblemap.put("b20_24_23", new arasuperobject(20,24,23,"هذه ايضا للحكماء---محاباة الوجوه في الحكم ليست صالحة"));
arasuperobject.biblemap.put("b20_24_24", new arasuperobject(20,24,24,"من يقول للشرير انت صدّيق تسبّه العامة. تلعنه الشعوب"));
arasuperobject.biblemap.put("b20_24_25", new arasuperobject(20,24,25,"اما الذين يؤدبون فينعمون وبركة خير تأتي عليهم"));
arasuperobject.biblemap.put("b20_24_26", new arasuperobject(20,24,26,"تقبّل شفتا من يجاوب بكلام مستقيم"));
arasuperobject.biblemap.put("b20_24_27", new arasuperobject(20,24,27,"هيّئ عملك في الخارج واعدّه في حقلك. بعد تبني بيتك"));
arasuperobject.biblemap.put("b20_24_28", new arasuperobject(20,24,28,"لا تكن شاهدا على قريبك بلا سبب. فهل تخادع بشفتيك"));
arasuperobject.biblemap.put("b20_24_29", new arasuperobject(20,24,29,"لا تقل كما فعل بي هكذا افعل به. ارد على الانسان مثل عمله"));
arasuperobject.biblemap.put("b20_24_30", new arasuperobject(20,24,30,"عبرت بحقل الكسلان وبكرم الرجل الناقص الفهم"));
arasuperobject.biblemap.put("b20_24_31", new arasuperobject(20,24,31,"فاذا هو قد علاه كله القريص وقد غطى العوسج وجهه وجدار حجارته انهدم"));
arasuperobject.biblemap.put("b20_24_32", new arasuperobject(20,24,32,"ثم نظرت ووجهت قلبي. رأيت وقبلت تعليما"));
arasuperobject.biblemap.put("b20_24_33", new arasuperobject(20,24,33,"نوم قليل بعد نعاس قليل وطي اليدين قليلا للرقود"));
arasuperobject.biblemap.put("b20_24_34", new arasuperobject(20,24,34,"فيأتي فقرك كعدّاء وعوزك كغاز"));
arasuperobject.biblemap.put("b20_25_1", new arasuperobject(20,25,1,"هذه ايضا امثال سليمان التي نقلها رجال حزقيا ملك يهوذا"));
arasuperobject.biblemap.put("b20_25_2", new arasuperobject(20,25,2,"مجد الله اخفاء الامر ومجد الملوك فحص الامر"));
arasuperobject.biblemap.put("b20_25_3", new arasuperobject(20,25,3,"السماء للعلو والارض للعمق وقلوب الملوك لا تفحص"));
arasuperobject.biblemap.put("b20_25_4", new arasuperobject(20,25,4,"ازل الزغل من الفضة فيخرج اناء للصائغ"));
arasuperobject.biblemap.put("b20_25_5", new arasuperobject(20,25,5,"ازل الشرير من قدام الملك فيثبت كرسيه بالعدل"));
arasuperobject.biblemap.put("b20_25_6", new arasuperobject(20,25,6,"لا تتفاخر امام الملك ولا تقف في مكان العظماء"));
arasuperobject.biblemap.put("b20_25_7", new arasuperobject(20,25,7,"لانه خير ان يقال لك ارتفع الى هنا من ان تحط في حضرة الرئيس الذي رأته عيناك"));
arasuperobject.biblemap.put("b20_25_8", new arasuperobject(20,25,8,"لا تبرز عاجلا الى الخصام لئلا تفعل شيئا في الآخر حين يخزيك قريبك"));
arasuperobject.biblemap.put("b20_25_9", new arasuperobject(20,25,9,"اقم دعواك مع قريبك ولا تبح بسر غيرك"));
arasuperobject.biblemap.put("b20_25_10", new arasuperobject(20,25,10,"لئلا يعيّرك السامع فلا تنصرف فضيحتك"));
arasuperobject.biblemap.put("b20_25_11", new arasuperobject(20,25,11,"تفاح من ذهب في مصوغ من فضة كلمة مقولة في محلها"));
arasuperobject.biblemap.put("b20_25_12", new arasuperobject(20,25,12,"قرط من ذهب وحلي من ابريز الموبخ الحكيم لاذن سامعة"));
arasuperobject.biblemap.put("b20_25_13", new arasuperobject(20,25,13,"كبرد الثلج في يوم الحصاد الرسول الامين لمرسليه لانه يرد نفس سادته"));
arasuperobject.biblemap.put("b20_25_14", new arasuperobject(20,25,14,"سحاب وريح بلا مطر الرجل المفتخر بهدية كذب"));
arasuperobject.biblemap.put("b20_25_15", new arasuperobject(20,25,15,"ببطء الغضب يقنع الرئيس واللسان الليّن يكسر العظم"));
arasuperobject.biblemap.put("b20_25_16", new arasuperobject(20,25,16,"أوجدت عسلا فكل كفايتك لئلا تتخم فتتقيأه"));
arasuperobject.biblemap.put("b20_25_17", new arasuperobject(20,25,17,"اجعل رجلك عزيزة في بيت قريبك لئلا يمل منك فيبغضك"));
arasuperobject.biblemap.put("b20_25_18", new arasuperobject(20,25,18,"مقمعة وسيف وسهم حاد الرجل المجيب قريبه بشهادة زور"));
arasuperobject.biblemap.put("b20_25_19", new arasuperobject(20,25,19,"سن مهتومة ورجل مخلّعة الثقة بالخائن في يوم الضيق"));
arasuperobject.biblemap.put("b20_25_20", new arasuperobject(20,25,20,"كنزع الثوب في يوم البرد كخل على نطرون من يغني اغاني لقلب كئيب"));
arasuperobject.biblemap.put("b20_25_21", new arasuperobject(20,25,21,"ان جاع عدوك فاطعمه خبزا وان عطش فاسقه ماء"));
arasuperobject.biblemap.put("b20_25_22", new arasuperobject(20,25,22,"فانك تجمع جمرا على راسه والرب يجازيك"));
arasuperobject.biblemap.put("b20_25_23", new arasuperobject(20,25,23,"ريح الشمال تطرد المطر والوجه المعبس يطرد لسانا ثالبا"));
